import React from "react";
import Table from 'react-bootstrap/Table';
import AirData from './AirData';

const factors = () => {
    const keys = Object.keys(AirData);
    return (
        <div>
            <Table bordered>
                <thead>
                    <tr>
                        <th>Flight Name</th>
                        <th>Departure Location</th>
                        <th>Wind Speed</th>
                        <th>Holidays</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        keys.map(data_key => (
                        <tr>
                          <td>{AirData[data_key].name}</td>
                          <td>{AirData[data_key].dest}</td>
                          <td>{AirData[data_key].speed}</td>
                          <td>{AirData[data_key].holidays}</td>
                        </tr>
                    ))
                    }
                </tbody>
            </Table>
        </div>
    );
}
export default factors;
